To compare the numbers -61 and 232, we need to consider their positions on the number line. On the number line, negative numbers are to the left of zero, and positive numbers are to the right of zero. Since -61 is to the left of 232, it is less than 232.

Therefore, the relationship between -61 and 232 is:

\boxed{\text{less than}}

To compare the two numbers -682 and -890, we need to consider the position of these numbers on the number line. On the number line, numbers to the right are greater than numbers to the left. Therefore, -682 is to the right of -890 on the number line, which means -682 is greater than -890.

So, the relationship between -682 and -890 is:

\boxed{\text{greater than}}
